import React, { Component } from "react";

export default class Header extends Component {
  constructor(props) {
    super(props);
    this.state = { date: new Date() };
  }
  componentDidMount() {
    this.timerID = setInterval(() => this.tick(), 1000);
  }
  componentWillUnmount() {
    clearInterval(this.timerID);
  }
  tick() {
    this.setState({ date: new Date() });
  }
  render() {
    const style = {
      logoImg: { width: 70, width: 70 },
      boderBot: { borderBottom: "1px solid gray" },
      textLogo: { fontSize: 30, marginLeft: 20 },
    };
    return (
      <div className="head-flex justify-cen" style={style.boderBot}>
        <div className="d-flex justify-cen">
          <img
            src={process.env.PUBLIC_URL + "/img/starbucksLogo.png"}
            style={style.logoImg}
          ></img>
          <p
            className="text-font w-600 green"
            style={{ fontSize: "30px", marginLeft: "20px" }}
          >
            OGS Cafe
          </p>
        </div>

        <p className="justify-cen">{this.state.date.toLocaleTimeString()}</p>
      </div>
    );
  }
}
